import React from 'react';
import '../styles/Nosotros.css';

const Nosotros = () => {
    return (
        <div className="nosotros-container">
            <h1>Sobre Nosotros</h1>
            <p>
                Bienvenido a nuestro hostal, un lugar acogedor donde te sentirás como en casa.
                Contamos con instalaciones modernas y cómodas, perfectas para tu estadía.
            </p>
            <img src="URL_DE_LA_IMAGEN_DEL_HOSTAL" alt="Imagen del Hostal" className="nosotros-image" />
        </div>
    );
};

export default Nosotros;
